--
-- Name: account_id(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION account_id() RETURNS trigger
    LANGUAGE plpgsql
    AS $$DECLARE accountid integer;BEGIN IF NEW."COA_AccountLevel"= '1' THEN SELECT MAX("COA_Account_id"::integer) + 1000 INTO New."COA_Account_id" FROM "tblACC_ChartAccount" WHERE "COA_AccountType" = NEW."COA_AccountType" AND "COA_AccountLevel" = '1'; ELSE SELECT MAX("COA_Account_id"::integer) + 1 INTO New."COA_Account_id" FROM "tblACC_ChartAccount" WHERE "COA_Parent" = NEW."COA_Parent"; END IF; Return NEW; END;$$;


ALTER FUNCTION public.account_id() OWNER TO postgres;

--
-- Name: append(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION append() RETURNS trigger
    LANGUAGE plpgsql
    AS $$ BEGIN New."IM_Item_id":= concat(New."IM_Item_id",'-',nextval('item_sequence')); Return NEW; END; $$;


ALTER FUNCTION public.append() OWNER TO postgres;

--
-- Name: apvheaderamount(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION apvheaderamount() RETURNS trigger
    LANGUAGE plpgsql
    AS $$BEGIN IF (TG_OP = 'DELETE') THEN UPDATE "tblACC_APVHeader" SET "APV_Amount" = ("APV_Amount" - OLD."APVD_Amount") WHERE "APV_DocNo" = OLD."APVD_PFK_DocNo"; RETURN OLD;ELSIF (TG_OP = 'UPDATE') THEN UPDATE "tblACC_APVHeader" SET "APV_Amount" = ("APV_Amount" - (NEW."APVD_LineDiscAmount" - OLD."APVD_LineDiscAmount")) WHERE "APV_DocNo" = NEW."APVD_PFK_DocNo"; NEW."APVD_AmountLCY" := (((OLD."APVD_Qty" * OLD."APVD_UnitPrice") * OLD."APVD_ExchangeRate") - (NEW."APVD_LineDiscAmount" * NEW."APVD_ExchangeRate")); NEW."APVD_Amount" := ((OLD."APVD_Qty" * OLD."APVD_UnitPrice") - NEW."APVD_LineDiscAmount"); RETURN NEW;ELSIF (TG_OP = 'INSERT') THEN UPDATE "tblACC_APVHeader" SET "APV_Amount" = ("APV_Amount" + NEW."APVD_Amount") WHERE "APV_DocNo" = NEW."APVD_PFK_DocNo"; RETURN NEW;END IF;END;$$;


ALTER FUNCTION public.apvheaderamount() OWNER TO postgres;

--
-- Name: apvheaderamountwithdiscount(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION apvheaderamountwithdiscount() RETURNS trigger
    LANGUAGE plpgsql
    AS $$BEGINSELECT (NEW."APV_Amount" - (NEW."APV_PaymentDiscount"- OLD."APV_PaymentDiscount")), (NEW."APV_Amount"* COALESCE("ER_ConvCurrencyRate",1)) - ((NEW."APV_PaymentDiscount" - OLD."APV_PaymentDiscount")*(COALESCE("ER_ConvCurrencyRate",1))) INTO NEW."APV_Amount" ,NEW."APV_AmountLCY" FROM "tblACC_APVHeader" LEFT JOIN "tblCOM_Supplier" ON "S_Id" = "APV_SupplierID"LEFT JOIN "tblCOM_Company" ON "APV_Company" = "COM_Id" LEFT JOIN "tblACC_ExchangeRate" ON "ER_FK_BaseCurrency_id" = "S_FK_Attribute_Currency_id" AND "ER_FK_ConvCurrency_id" = "tblCOM_Company"."COM_Currency"WHERE "APV_DocNo" = NEW."APV_DocNo";return NEW;END;$$;


ALTER FUNCTION public.apvheaderamountwithdiscount() OWNER TO postgres;

--
-- Name: chartaccount_update(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION chartaccount_update() RETURNS trigger
    LANGUAGE plpgsql
    AS $$DECLARE accountid integer;BEGIN IF NEW."COA_AccountLevel"= '1' AND NEW."COA_AccountType" != OLD."COA_AccountType" THEN SELECT MAX("COA_Account_id"::integer) + 1000 INTO New."COA_Account_id" FROM "tblACC_ChartAccount" WHERE "COA_AccountType" = NEW."COA_AccountType" AND "COA_AccountLevel" = '1'; ELSEIF NEW."COA_AccountLevel"= '2' AND NEW."COA_AccountType" != OLD."COA_AccountType" THEN SELECT MAX("COA_Account_id"::integer) + 1 INTO New."COA_Account_id" FROM "tblACC_ChartAccount" WHERE "COA_Parent" = NEW."COA_Parent"; END IF; Return NEW; END;$$;


ALTER FUNCTION public.chartaccount_update() OWNER TO postgres;

--
-- Name: cvdetailsprocess(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION cvdetailsprocess() RETURNS trigger
    LANGUAGE plpgsql
    AS $$BEGIN IF (TG_OP = 'DELETE') THENUPDATE "tblACC_APVHeader" SET "APV_Status" = 'Approved' WHERE "APV_DocNo" = OLD."CVD_RefDocNo";UPDATE "tblACC_CVHeader" SET "CV_CheckAmount" = "CV_CheckAmount" - OLD."CVD_Amount" WHERE "CV_DocNo" = OLD."CVD_PFK_DocNo"; RETURN OLD;ELSIF (TG_OP = 'INSERT') THENUPDATE "tblACC_APVHeader" SET "APV_Status" = 'With CV' WHERE "APV_DocNo" = NEW."CVD_RefDocNo";UPDATE "tblACC_CVHeader" SET "CV_CheckAmount" = "CV_CheckAmount" + NEW."CVD_Amount" WHERE "CV_DocNo" = NEW."CVD_PFK_DocNo"; RETURN NEW;END IF;END;$$;


ALTER FUNCTION public.cvdetailsprocess() OWNER TO postgres;

--
-- Name: line_no(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION line_no() RETURNS trigger
    LANGUAGE plpgsql
    AS $$BEGIN CREATE TEMP TABLE temp ON COMMIT DROP AS SELECT NEW.*; EXECUTE 'UPDATE temp SET ' || quote_ident(TG_ARGV[0])|| ' = ' || '(SELECT COALESCE(MAX('|| quote_ident(TG_ARGV[0]) ||')+1,1) FROM '|| quote_ident(TG_TABLE_NAME) || ' WHERE ' ||quote_ident(TG_ARGV[1])|| ' = (SELECT ' || quote_ident(TG_ARGV[1]) || ' FROM temp))';SELECT * FROM temp INTO NEW;RETURN NEW;END;$$;


ALTER FUNCTION public.line_no() OWNER TO postgres;

