CREATE FUNCTION rpheaderamount() RETURNS trigger
    LANGUAGE plpgsql
    AS $$BEGIN IF (TG_OP = 'DELETE') THENUPDATE "tblACC_RPHeader" SET "RPH_Amount" = ("RPH_Amount" - OLD."RPD_Amount"), "RPH_AmountLCY" = ("RPH_AmountLCY" - (OLD."RPD_Amount" * OLD."RPD_ExchangeRate")) WHERE "RPH_DocNo" = OLD."RPD_PFK_DocNo"; RETURN OLD;ELSIF (TG_OP = 'UPDATE') THEN UPDATE "tblACC_RPHeader" SET "RPH_Amount" = ("RPH_Amount" + (NEW."RPD_Amount" - OLD."RPD_Amount")), "RPH_AmountLCY" = ("RPH_AmountLCY" + ((NEW."RPD_Amount" - OLD."RPD_Amount") * NEW."RPD_ExchangeRate"))WHERE "RPH_DocNo" = NEW."RPD_PFK_DocNo"; RETURN NEW;ELSIF (TG_OP = 'INSERT') THEN UPDATE "tblACC_RPHeader" SET "RPH_Amount" = ("RPH_Amount" + NEW."RPD_Amount"), "RPH_AmountLCY" = ("RPH_AmountLCY" + (NEW."RPD_Amount" * NEW."RPD_ExchangeRate")) WHERE "RPH_DocNo" = NEW."RPD_PFK_DocNo"; RETURN NEW;END IF;END;$$;


ALTER FUNCTION public.rpheaderamount() OWNER TO postgres;

